  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chautauqua NWR
  outlines Refuge accomplishments from August through October of 1941. The report
  begins by summarizing the weather conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments, plantings, and collections
  and receipts. A progress report on field investigations and applied research is
  also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, hunting, fishing, and violations. Photographs are attached.\",\n\t\"owner_org\":
